import React from "react";
import App from "./App";
import './App.css'

function Header(props) {

    return(
        <header className="header">
            <h1 className="logo">Progbr</h1>
            <ul className="menu">
                <li className="about">About</li>
                <li className="buy">Buy</li>
                <li className="contact">Contact</li>
            </ul>
        </header>
    );
}

export default App;
